import React from 'react';

const UserPage = () => {
  return (
    <div className="min-h-screen bg-white p-4">
      <div className="max-w-4xl mx-auto pt-20">
        <h1 className="text-3xl font-bold mb-6 flex justify-center">동영상 페이지</h1>
        <p className="text-gray-600 justify-center">여기에 동영상을 띄우기</p>
      </div>
    </div>
  );
};

export default UserPage;
